import React from "react";
import { Table } from "react-bootstrap";

function Tableboot() {
  const obj = [
    {
      firstname: "John",
      lastname: "Smith",
      username: "@johnsmith32",
    },
    {
      firstname: "Hellen",
      lastname: "Smith",
      username: "@hellensmith22",
    },
  ];
  return (
    <div className="container" style={{ marginTop: "5vh" }}>
        obj.map
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Username</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1</td>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <td>2</td>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
        </tbody>
      </Table>
    </div>
  );
}

export default Tableboot;
